import React, { Component } from 'react';
import css from './main.scss';

export default class Form extends Component {
    render() {

        const Mid = this.props;

        return (
            <form className={css.from} method={Mid.method}  >
                <input name="token" type="hidden" value={Mid.token} />
                <input name="hash" type="hidden" value={Mid.hash} />
                {
                    Mid.content.map()
                }
            </form>
        );
    }
}
